        //// Resize to Target Frame
        context.saveGState()
        let resizedFrame: CGRect = resizing.apply(rect: CGRect(x: 0, y: 0, width: 50, height: 50), target: targetFrame)
        context.translateBy(x: resizedFrame.minX, y: resizedFrame.minY)
        context.scaleBy(x: resizedFrame.width / 50, y: resizedFrame.height / 50)


        //// Color Declarations
        let foreground = UIColor(red: 1.000, green: 1.000, blue: 1.000, alpha: 1.000)

        //// Variable Declarations
        let tickAngel: CGFloat = tickProgress * -360

        //// Bezier 2 Drawing
        context.saveGState()
        context.translateBy(x: 25, y: 25)
        context.rotate(by: -tickAngel * CGFloat.pi/180)

        let bezier2Path = UIBezierPath()
        bezier2Path.move(to: CGPoint(x: 0, y: -18))
        bezier2Path.addCurve(to: CGPoint(x: -0.83, y: -17.56), controlPoint1: CGPoint(x: -0.35, y: -18), controlPoint2: CGPoint(x: -0.65, y: -17.82))
        bezier2Path.addCurve(to: CGPoint(x: -1, y: -17), controlPoint1: CGPoint(x: -0.94, y: -17.4), controlPoint2: CGPoint(x: -1, y: -17.21))
        bezier2Path.addCurve(to: CGPoint(x: -1, y: -2.83), controlPoint1: CGPoint(x: -1, y: -17), controlPoint2: CGPoint(x: -1, y: -7.66))
        bezier2Path.addCurve(to: CGPoint(x: -3, y: 0), controlPoint1: CGPoint(x: -2.17, y: -2.42), controlPoint2: CGPoint(x: -3, y: -1.31))
        bezier2Path.addCurve(to: CGPoint(x: 0, y: 3), controlPoint1: CGPoint(x: -3, y: 1.66), controlPoint2: CGPoint(x: -1.66, y: 3))
        bezier2Path.addCurve(to: CGPoint(x: 3, y: 0), controlPoint1: CGPoint(x: 1.66, y: 3), controlPoint2: CGPoint(x: 3, y: 1.66))
        bezier2Path.addCurve(to: CGPoint(x: 1, y: -2.83), controlPoint1: CGPoint(x: 3, y: -1.31), controlPoint2: CGPoint(x: 2.17, y: -2.42))
        bezier2Path.addCurve(to: CGPoint(x: 1, y: -17), controlPoint1: CGPoint(x: 1, y: -7.66), controlPoint2: CGPoint(x: 1, y: -17))
        bezier2Path.addCurve(to: CGPoint(x: 0, y: -18), controlPoint1: CGPoint(x: 1, y: -17.55), controlPoint2: CGPoint(x: 0.55, y: -18))
        bezier2Path.close()
        bezier2Path.move(to: CGPoint(x: 23, y: 0))
        bezier2Path.addCurve(to: CGPoint(x: 0, y: 23), controlPoint1: CGPoint(x: 23, y: 12.68), controlPoint2: CGPoint(x: 12.68, y: 23))
        bezier2Path.addCurve(to: CGPoint(x: -23, y: 0), controlPoint1: CGPoint(x: -12.68, y: 23), controlPoint2: CGPoint(x: -23, y: 12.68))
        bezier2Path.addCurve(to: CGPoint(x: 0, y: -23), controlPoint1: CGPoint(x: -23, y: -12.68), controlPoint2: CGPoint(x: -12.68, y: -23))
        bezier2Path.addCurve(to: CGPoint(x: 23, y: 0), controlPoint1: CGPoint(x: 12.68, y: -23), controlPoint2: CGPoint(x: 23, y: -12.68))
        bezier2Path.close()
        foreground.setFill()
        bezier2Path.fill()

        context.restoreGState()
        
        context.restoreGState()

    }

